import './User.css';
import Head from './../Headings/Head';

export default function Table(props){
    return(
        <>
        <Head head="Users List"/>
        <table className="table">
            <caption></caption>
            <thead>
                <th>Name</th>
                <th>Email</th>
                <th>Phone</th>
            </thead>
            <tbody>
                {props.props.map((val,i)=>{
                    return( 
                        <tr key={i}>
                            <td>{val.Name}</td>
                            <td>{val.Email}</td>
                            <td>{val.Phone}</td>
                        </tr>
                    );
                })}
            </tbody>
        </table>
        </>

    )
}
